import React, { Component } from "react";

const Project = props => {
  console.log(props);
  return (
    <React.Fragment>
      <h1>Project {props.projects.uid}</h1>
      <h3>Name: {props.projects.shortname}</h3>
    </React.Fragment>
  );
};

export default Project;
